Nacionalinio aktyvių mamų sambūrio atstovė  Rasa Žemaitė  neseniai feisbuko paskyroje pasidalijo nuotrauka rašto, kurį jos pažįstami gavo iš Valstybinės mokesčių inspekcijos. Sprendžiant iš rašte pateiktos informacijos, nuo 2011 m. pradžios iki 2015 m. pabaigos žmogus buvo sumokėjęs privalomą mokėti gyventojų pajamų mokestį ( GPM ). Jo prievolė arba skola buvo apskritas nulis. Tačiau  VMI  jam vis tiek priskaičiavo skirtingas delspinigių sumas už kiekvienus metus – nuo 0,71 Eur iki 5,54 Eur. Žinoma moteris negalėjo tuo patikėti. „Net jei ir visi mokesčiai sumokėti, vis tiek esi skolininkas su delspinigiais VMI. Kaip iš nulinės skolos pasidaro n suma palūkanų? Mano raštingumo ribos peržengtos – gal kas iš jūsų padėsite suprasti“, – prašė ji. DELFI ji taip pat pasakojo, kad pažįstami esą net buvo sumokėję viršaus to, ką privalėjo sumokėti. „Blogiausia, kad žmonės juk VMI bijo labiau nei maro. Juk gavę tokį laišką didžioji jų dauguma net nesitikrins, kas ir kaip – mokės dėl šventos ramybės. Ir kas per valstybės požiūris į mokesčių mokėtoją, kuris domisi jo prievolėmis mokėti tuos mokesčius, jei ji neinformuoja, kad penkerius metus kaupiami delspinigiai? Gali susidaryti įspūdį, kad VMI sąmoningai delsia informuoti asmenį apie tų ar prieš tai buvusių metų sukauptus delspinigius, kad po penkerių išsireikalautų daugiau“, – svarstė ji. (function(d, s, i, r) {
