		})(document, 'script', 'facebook-jssdk', 'fb-root'); Vis dėlto VMI prie FM Mokestinių prievolių departamento direktorė  Stasė Aliukonytė-Šnirienė  aiškino, kad jokio kriminalo čia nėra: „Bendrai galima pasakyti, kad mokesčių mokėtojai, pradelsę, t. y. laiku nemokėję mokesčių, juos sumoka po termino. Jie neįvertina, kad delspinigiai pradedami skaičiuoti nuo kitos dienos, kai mokestis pagal tuo metu galiojusius mokesčių teisės aktus turėjo būti sumokėtas į biudžetą. Mokestis sumokėtas (prievolė įvykdyta ir suma lygi 0), tačiau delspinigiai liko. Vadinasi, tokį mokesčių mokėtoją pasieks VMI pranešimas apie neįvykdytą prievolę. Ir jei gyventojas nesumoka skolos biudžetui arba nesikreipia su prašymu išdėstyti mokestinės nepriemokos sumokėjimą, mokesčių administratorius yra priverstas inicijuoti išieškojimo veiksmus. Išieškojimo veiksmai turi būti inicijuoti per 5 m. nuo skolos atsiradimo dienos.“ Direktorė taip pat priminė, kad mokesčių nepriemoką ar permoką kiekvienas bet kada gali pasitikrinti, prisijungę prie  Mano VMI  esančios Mokesčių mokėtojo kortelės, o kilus klausimams skambinti į Mokesčių informacijos centrą. „VMI siekia, kad mokesčių mokėtojai savarankiškai ir savanoriškai laiku mokėtų mokesčius vykdytų kitas mokestines prievoles. Todėl mokesčių mokėtojams, kurie dėl vienokių ar kitokių priežasčių nevykdo savo mokestinių prievolių, visų pirma siunčiami priminimai, raginimai tai padaryti, apie tai informuojami asmeninėje Mano VMI paskyroje“, – komentavo S. Aliukonytė-Šnirienė. Ji pateikė ir bendrą situaciją, kaip mokestinės skolos neturinčiam gyventojui gali būti pradėti skaičiuoti delspinigiai. Pvz., 2012 m. moteris nuomojo žemės sklypą kitam gyventojui. Metams pasibaigus, iki 2013 m. gegužės 1 d. ji privalėjo pateikti metinę pajamų deklaraciją, apskaičiuoti ir sumokėti GPM. Tačiau gyventoja iki nurodyto termino deklaracijos nepateikė ir GPM nesumokėjo. 2014 m. lapkričio mėn. 18 d., gyventoja vėluodama galiausiai nusprendė pateikti minėtą deklaraciją už 2012 metus ir anuomet apskaičiuotą GPM sumokėjo. Kadangi ji deklaraciją turėjo pateikti ir GPM mokestį sumokėti iki 2013 m. gegužės 1 d., už laiku nesumokėtą GPM buvo apskaičiuoti ir delspinigiai. Vadinasi, tokiu atveju mokesčių mokėtojas sumokėjo tik apskaičiuotą GPM sumą (prievolę), o už pavėluotą GPM sumokėjimą delspinigių nesumokėjo. Tokiu atveju prievolės suma 0 Eur, o delspinigių suma ir yra nurodyta, nes GPM sumokėtas pavėluotai.
